import React from "react"
import '../App.css';

function HEAD() {
  return (
    <div className="HEAD">

     <span> <p>Сервис поиска компаний</p>

      <div className="example-1">

        <div className="form-group">
          <label className="label">
            <i className="material-icons">attach_file</i>
            <span class="title">Добавить файл</span>
            <input type="file" />
          </label>
        </div>
      </div>
</span>
    </div>
  );
}

export default HEAD;
